/*
* @return 返回一个组件数组, 数组中每个元素为每个问题对应的预览组件
* @accept `ques`: 一个问题描述数组, 数组中每个元素应当包含该问题的 title, type, 以及 options 等必要属性;
* */
import React from "react";

export function renderPreview(ques) {
	const elements = [];
	ques.forEach(que => {
		switch (que.type) {
			case 'text': {
				elements.push((
					<fieldset disabled={true}>
						<legend>{que.title}</legend>
						<input type="text"/>
					</fieldset>
				));
				break;
			}
			case 'location': {
				elements.push((
					<fieldset disabled={true}>
						<legend>{que.title}</legend>
						<select name="location" id="">
							<option value="text">输入</option>
							<option value="select">选择</option>
							<option value="location">定位精确位置信息</option>
						</select>
						{isSelect ? (
							<div>{'请选择所在城市'}</div>
						) : (
							<div>
								<div>{'纬度:'}{position?.latitude}</div>
								<div>{'经度:'}{position?.longitude}</div>
								<button onClick={handleGetPosition}>定位</button>
							</div>
						)}
					</fieldset>
				))
			}
		}
	});
	return elements;
}
